import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import UserRegistrationPage from "./UserRegistrationPage";
import RoomCreationPage from "./RoomCreationPage";
import ChatRoomPage from "./ChatRoomPage"; // New page for chat room after creation/join
import "./App.css";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<UserRegistrationPage />} />
        <Route path="/room" element={<RoomCreationPage />} />
        <Route path="/chat/:roomID" element={<ChatRoomPage />} />
      </Routes>
    </Router>
  );
}

export default App;
